import { loginFail, loginRequset, loginSuccess } from "../slices/authSlice"

export const auth = user => (dispatch)=>{
    try {
        dispatch(loginRequset)
        const {data} = user
        dispatch(loginSuccess(data))
    } catch (error) {
        dispatch(loginFail(error))
    }
}
